import React from 'react';
import './App.css';

function App() {
  return (
    <Router>
      <div>
        <Nav />
        <Switch>
          <Route exact path="/" component={main}/>
          <Route exact path="/user/:id" component={user} />
          <Route exact path="/subjects/:id" component={subject} />
          <Route component={NoMatch} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
